var FormationSelector = require('./FormationSelector.react.js');
var PlayerGroup = require('./PlayerGroup.react.js');
var PlayerGroupList = require('./PlayerGroupList.react.js');
var UserActions = require('./UserActions.react.js');
var PlayerFinder = require('./PlayerFinder.react.js');
var AppStore = require('../stores/AppStore.js');
var AppActionCreator = require('../actioncreators/AppActionCreators.js');

var React = require('react');


var Pitch = React.createClass({

  getInitialState: function() {
    var key = '';
    // TODO: Fix multiple things happening
    // TODO: Retrieve teamId from server when key is present and set it elsewhere
    if (this.props.params.teamId) {
      AppActionCreator.setCurrentTeam(this.props.params.teamId);
    }
    if (this.props.params.key) {
      key = this.props.params.key;      
    }    
    return {
      lineup: {},
      key: key
    };
  },

  componentWillUnmount: function() {
    AppStore.removeChangeListener(this._onChange);
  },

  componentDidMount: function() {
    AppStore.addChangeListener(this._onChange);
    if (this.state.key) {
      AppActionCreator.getLineup(this.state.key);
    } else {
      AppActionCreator.setFormation('4-4-2');
    }
  },

  _onChange: function() {
    this.setState({
      lineup: AppStore.getLineup()
    });
  },


  render: function() {
    return (
      <div>
      <div className='row'>
        <div className='col-xs-12 col-sm-9 col-md-7 col-lg-6'>
          <FormationSelector />
          <div className='pitch'>
          <span dangerouslySetInnerHTML={{__html: '<?xml version="1.0" encoding="utf-8"?><!-- Generator: Adobe Illustrator 19.0.0, SVG Export Plug-In . SVG Version: 6.00 Build 0)  --><svg version="1.1" id="Layer_1" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink" x="0px" y="0px"   width="490px" height="463px" viewBox="0 0 490 463" style="enable-background:new 0 0 490 463;" xml:space="preserve"><style type="text/css">  .st0{fill:#FFFFFF;stroke:#000000;stroke-miterlimit:10;}</style><image style="overflow:visible;" width="490" height="470" xlink:href="data:image/png;base64," transform="matrix(1 0 0 1 0 -7)"></image><path class="st0" d="M-250-137"/>'}}/>
          <PlayerGroupList pitch={this} lineup={this.state.lineup}/>
          <span dangerouslySetInnerHTML={{__html: '</svg>'}}/>
            
          </div>
          <UserActions />
        </div>
        <div className='col-xs-12 col-sm-3 col-md-5 col-lg-6'>
          <PlayerFinder />
        </div>
      </div>
      </div>
    );
  }
});

module.exports = Pitch;
